import React from 'react';
import { Navbar, Container, Row, Col } from 'react-bootstrap';
import HamburgerMenu from './HamburgerMenu.js';  // Assicurati di importare il tuo componente HamburgerMenu
import '../assets/css/navbar.css';  // Assicurati di importare il tuo foglio di stile personalizzato

const NavbarComponent = () => {
  return (
    <Navbar expand="lg" variant="dark" className="navbar">
      <Container>
        <Row className="top-section">
          <Col xs={3} className="hamburger">
            <HamburgerMenu />
          </Col>
          <Col xs={6} className="logo">
            <img
              src={require('../assets/images/thenewyorktimeslogo.png')}
              alt="New York Times Logo"
            />
          </Col>
        </Row>
      </Container>
    </Navbar>
  );
};

export default NavbarComponent;
